import React from 'react';
import "./rules.scss"
import Rule from "./rule";
const Rules = () => {
    return (
        <div className="main_cont">
            <div className="cont_zag">
                <div >Правила</div>
            </div>
            <div className="cont_rules">
                <Rule data={["1. Введение", "Основнойцелью формата USD является привлечение молодых спортсменов в автозвук, как в вид техническогоавтоспорта в России. Площадку формата можно считать стартовой, для начала занятия данным видомавтоспорта, так как, правила формата наиболее лояльны и позволяют всем без исключения проверитьсвою аудио систему и свое мастерство. Профессиональный судейский состав - это люди, которые непервый год занимаются автозвуком и являются титулованными спортсменами в различных федерациях.Основной целью судьи является, соблюдение правил формата и оказание грамотной, квалифицированнойпомощи спортсмену, как в разъяснении правил формата так и в обоснованном ответе, для устранения,исправления или улучшения системы спортсмена на будущее. В данном формате в основном борютсяповседневные системы, которые разделены классами, имеющими свои ограничение как для той или инойсистемы, так и для различных видов кузова автомобиля."]}/>
                <Rule data={["2. Правила замеров SPL", ""]}/>
            </div>
        </div>
    );
};

export default Rules;
